import React from 'react';
import {
    VictoryBar,
    VictoryChart,
    VictoryLine,
    VictoryPie,
  } from "victory";

const UserDetails = ({user}) => {



    return(
        <div className="graphs">
            <h1>Yearly activity</h1>
            <VictoryChart>
                <VictoryLine
                    data={[
                        { x: "Jan", y: 5 },
                        { x: "Feb", y: 4 },
                        { x: "Mar", y: 3 },
                        { x: "Apr", y: 0 },
                        { x: "May", y: 1 },
                        { x: "Jun", y: 3 },
                        { x: "Jul", y: 5 },
                        { x: "Aug", y: 4 },
                        { x: "Sep", y: 0 },
                        { x: "Oct", y: 1 },
                        { x: "Nov", y: 7 },
                        { x: "Dec", y: 5 }
                        ]}
                />
            </VictoryChart>
            <h1>Weekday activity</h1>
            <VictoryPie
                data={[
                    { x: "Mon", y: 5 },
                    { x: "Tue", y: 4 },
                    { x: "Wed", y: 6 },
                    { x: "Thu", y: 4 },
                    { x: "Fri", y: 3 },
                    { x: "Sat", y: 2 },
                    { x: "Sun", y: 9 }
                    ]}
            />
        </div>
    )
}
export default UserDetails;
